  false,\n\t\"url\": null,\n\t\"notes\": \" This data set consists of photo centers
  of raw aerial images representingnttttmulti-spectral (red, green, blue, near-infrared)
  digital aerial imagery of the LasnttttConchas Fire that burned in the Santa Fe National
  Forest in the Jemez Mountains ofnttttcentral New Mexico in the summer of 2011. The
  Area of Interest (AOI) is 632,000nttttacres and is larger than the actual burn acreage
  of approximately 150,000 acres thatnttttlies within the AOI. Aerial imagery was
  collected with a frame - based Z/I DigitalnttttMapping Camera at an average elevation
  of 4,500 feet above ground; generating annttttaverage ground sample distance (gsd)
  of 0.45 feet. The aerial imagery will be usednttttto create natural color and false
  color infrared digital orthophotos of the AOI at anttttre-sampled gsd of 0.5 foot.
  The imagery will support the Forest Service Burned AreanttttEmergency Response (BAER)
  program that addresses landscape damage due to the fire,nttttwith the goal of protecting
  life, property, water quality, and deterioratednttttecosystems from further damage
  now that the fire is out. Airborne GPS proceduresnttttwere used to determine the
  camera station coordinates of each exposure. The nearestnttttCORS base station was
  used to post process these coordinates with Applanix softwarenttttinto the project
  datum of NAD83/NAVD 88, UTM Zone 13, meters. \",\n\t\"license_title\": null,\n\t\"extras\":
